/**
 * @see https://github.com/asyncjs/Javascript-Jungle/wiki/api
 */
var dataURI = "data:image/png;base64,";

var img = new Image();
img.src = dataURI;

var creature = jj.createCreature('angrybird', function (layer) {
	$ = jj.jQuery;
	var jungleHeight = $(layer.el).parent().height();
	var jungleWidth = $(layer.el).parent().width();
	var x = -100;
	var y = (jungleHeight / 4) * 3;
	var w = 50;
	var acc_x = 0;
	var acc_y = 0.5;
	var v_x = 50;
	var v_y = -70;

	var initial_x = x;
	var initial_y = y;
	var initial_v_y = v_y;
	var initial_v_x = v_x;
	var canvas = $("<canvas />").attr("width", 50).attr("height", 50).css({ position: "relative", top: initial_y,
		left: initial_x }).appendTo(layer.el)[0];

	
	//ctx.arc(25, 25, 10, 0, 2 * Math.PI);
	//ctx.fillStyle = "red";
	//ctx.fill();
	//ctx.closePath();
	var ctx = canvas.getContext("2d");
	var step = 0;
	var reset = null;
	setInterval(function() {
		step += 1
		// s = ut + 1/2at2
		var s_x = (v_x * step) + (0.5 * acc_x * (step*step));
		v_x = v_x + (acc_x * step);
		var s_y = (v_y * step) + (0.5 * acc_y * (step*step));
		// v = u + at
		v_y = v_y + (acc_y * step);
		
		x = initial_x + s_x;
		y = initial_y + s_y;
		$(canvas).css({ top: y, left: x });

		ctx.clearRect(0, 0, 50, 50);
		ctx.moveTo(0, 0);
		ctx.save();
		ctx.scale(0.2,0.2);
		ctx.rotate(0.2);
		ctx.drawImage(img, 0, 0);
		ctx.restore();

		if(!reset && (x > jungleWidth + 100 || x < -100)) {
			reset = true;
			setTimeout(function() {
				x = initial_x;
				y = initial_y;
				v_x = (Math.random() * 90);
				v_y = -(Math.random() * 90);
				step = 0;
				reset = null;
			}, 1000);
		}
	}, 100);
});
